import Countdown from "../Layout/Common/Countdown";
import SignInForm from '../Layout/SignIn/SignInForm';
import React, { useState } from 'react';


export function SignedOutPage(props) {

    const [openForm, setOpenForm] = useState(false);

    return (
        <div className="signedOut" >
            <div className="container">
                <Countdown />
                <div className="message">
                    <p>Paul</p><p>&</p><p>Elyse</p>
                </div>
                {openForm ?
                    <SignInForm
                        setResponse={props.setResponse}
                        setAuth={props.setAuth} /> :
                    <p className="signInButton"
                        onClick={setOpenForm(true)}>
                        Join Us
                    </p>}
                <p className="contact">Having trouble signining in? Contact Us at <i>paulandelysewedding@gmail.com</i></p>
                <p className="photocredit">Photo Credit: Brittany Fleming - Facebook: @bflemingphoto Instagram: @bflemingphotography</p>
            </div>
        </div >
    );
}
